import ResultExampleGraph from "./ResultExampleGraph";
import { useEffect, useState } from "react";
import PropTypes from "prop-types";
import * as d3 from "d3";
import { useChartDimensions, accessorPropsType } from "../utils/Utils";

const totalAccessor = (d) => d.total;
const bweightAccessor = (d) => d.bweight;

const url =
  "http://127.0.0.1:3000/events/years/2021/xxxii-olympic-games/result";

function ResultDashboard() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [ref, dms] = useChartDimensions();

  useEffect(() => {
    d3.json(url).then((data) => {
      setData(data);
      setLoading(false);
    });
    return () => undefined;
  }, []);

  return (
    <div className="ResultDashboard" ref={ref}>
      <h2>Result Dashboard</h2>

      {loading && <div>Loading...</div>}
      {!loading && (
        <ResultExampleGraph
          data={data}
          xAccessor={bweightAccessor}
          yAccessor={totalAccessor}
          xLabel="Bodyweight"
          yLabel="Total"
        />
      )}
    </div>
  );
}

ResultDashboard.propTypes = {
  data: PropTypes.array,
  xAccessor: accessorPropsType,
  yAccessor: accessorPropsType,
  label: PropTypes.string,
};

ResultDashboard.defaultProps = {
  xAccessor: (d) => d.x,
  yAccessor: (d) => d.y,
};

export default ResultDashboard;
